--  DDL for Trigger INFORMACAOSERVICO_IDINFORMAC_1
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "INFORMACAOSERVICO_IDINFORMAC_1" BEFORE INSERT ON informacaoservico
FOR EACH ROW
DECLARE 
v_newVal NUMBER(12) := 0; 
v_incval NUMBER(12) := 0; 
BEGIN
  IF INSERTING AND :new.idInformacaoServico IS NULL THEN
    SELECT  informacaoservico_idInformacao.NEXTVAL INTO v_newVal FROM DUAL; 
    -- If this is the first time this table have been inserted into (sequence == 1)
    IF v_newVal = 1 THEN 
      --get the max indentity value from the table
      SELECT NVL(max(idInformacaoServico),0) INTO v_newVal FROM informacaoservico; 
      v_newVal := v_newVal + 1; 
      --set the sequence to that value
      LOOP
           EXIT WHEN v_incval>=v_newVal; 
           SELECT informacaoservico_idInformacao.nextval INTO v_incval FROM dual; 
      END LOOP; 
    END IF; 
    --used to emulate LAST_INSERT_ID()
    --mysql_utilities.identity := v_newVal; 
   -- assign the value from the sequence to emulate the identity column
   :new.idInformacaoServico := v_newVal; 
  END IF; 
END;

ALTER TRIGGER "INFORMACAOSERVICO_IDINFORMAC_1" ENABLE;
