CREATE OR REPLACE TRIGGER "SEQUENCE_BLOCK_ID_TRG" BEFORE INSERT ON sequence_block_controller
FOR EACH ROW
DECLARE 
v_newVal NUMBER(12) := 0; 
v_incval NUMBER(12) := 0; 
BEGIN
  IF INSERTING AND :new.id IS NULL THEN
    SELECT  SEQUENCE_BLOCK_ID_SEQ.NEXTVAL INTO v_newVal FROM DUAL; 
    -- If this is the first time this table have been inserted into (sequence == 1)
    IF v_newVal = 1 THEN 
      --get the max indentity value from the table
      SELECT NVL(max(id),0) INTO v_newVal FROM sequence_block_controller; 
      v_newVal := v_newVal + 1; 
      --set the sequence to that value
      LOOP
           EXIT WHEN v_incval>=v_newVal; 
           SELECT SEQUENCE_BLOCK_ID_SEQ.nextval INTO v_incval FROM dual; 
      END LOOP; 
    END IF; 
    --used to emulate LAST_INSERT_ID()
    --mysql_utilities.identity := v_newVal; 
   -- assign the value from the sequence to emulate the identity column
   :new.id := v_newVal; 
  END IF; 
END;

ALTER TRIGGER "SEQUENCE_BLOCK_ID_TRG" ENABLE;